st.markdown(html, unsafe_allow_html=True)


a=pd.read_csv(r"D:\try\shoes.csv")
a.sales=a.sales.str.replace("人付款","").astype(int)
#求出各个商品的销售额并把它并入到原始数据框中去
z1=a.sales*a.price
z1.name="xse"
a=pd.concat([a,z1],axis=1)#给序列命名之后添加入数据框就会直接以序列名作为列标
location=a.location.str.split(" ",expand=True)
a["province"]=location[0]
a["city"]=location[1]
# 假数据
dates = pd.date_range('20220101', periods=7)
df = pd.DataFrame(np.random.randn(7, 4), index=dates, columns=list('ABCD'))

c21,c22=st.columns([1,3])



# 第一页 -- 简介，欢迎词
def introduction():
    with c22:
        st.title('男鞋数据分析报告')
        st.write('报告人：小强')

# 第二页 -- 数据概述，简要数据的展示
def data_overview_h():
    st.header('数据概述')
    st.table(a[['itemid','info.鞋面材质', 'info.风格','location', 'nick', 'price', 'sales','xse', 'province','city']].head())
    st.write("数据字段")
    st.table(pd.DataFrame(a.columns).T)
    
def data_overview_c():
    st.header('数据概述')
    st.table(a[['price','sales','xse']].describe())
    st.markdown("* 男鞋商品价格中位数为258 \n * 销售额的标准差很大，说明二八效应明显")

# 第三页 -- 绘制折线图
def line_chart():
    st.header('各店铺不同鞋面材质的商品数量')
    option4 = st.multiselect(
        '选择你要比较的店铺',
        a.groupby("nick").size().sort_values(ascending=False).index,
        ['意尔康男鞋旗舰店'])
    
    p1=a.groupby('info.鞋面材质').size().sort_values()
    p1.name="all"
    
    chart0 = {
      "yAxis": {
        "type": 'category',
        "data": p1.index.tolist()
      },
      "xAxis": {
        "type": 'value'
      },
      "tooltip": {
          "trigger": 'axis',
        },
      "legend": {},
      "series": [
          {
            "data": p1.values.tolist(),
            "type": 'bar',
            "name":"all"
          },
      ]
    }

    for i in option4:
        p2=a[a["nick"]==i].groupby('info.鞋面材质').size()
        p2.name=i
        p1=pd.concat([p1,p2],axis=1).fillna(0)
        chart0["series"].append({
          "data": p1[i].values.tolist(),
          "type": 'bar',
          "name": i
        })
    
    st_echarts(chart0)
    st.markdown("* 男鞋旗舰店头层牛皮鞋占主导 \n * 米兰多格店主攻二层牛皮材质")


# 第四页 -- 绘制柱状图
def bar_chart():
    with c21:
        st.markdown("## 不同材质的价格分布 \n * 头层牛皮有多个价格商品数量峰值 \n * pu皮的价格普遍偏低")
    with c22:
        p1=a.groupby("info.鞋面材质").size().sort_values(ascending=False)
        
        option = {
            "xAxis": {
                "type": "category",
                "data": p1.index.tolist(),
            },
            "yAxis": { "type": "value" },
            "tooltip": {
                "trigger": 'axis',
              },
            "series": [
                {"data": p1.values.tolist(), "type": "bar" }
            ],
        }
        events = {
            "click": "function(params) { console.log(params.name); return params.name }",
            "dblclick":"function(params) { return [params.type, params.name, params.value] }"
        }
        value = st_echarts(option, events=events)
        
        if value:
            p2=a[a["info.鞋面材质"]==value].groupby("price").size()
            data=[]
            for i in p2.items():
                data.append(list(i))
            option1 = {
                "xAxis": {
                    "min":0,
                    "max":600
                },
                "yAxis": {
                    },
                "tooltip": {
                    "trigger": 'axis',
                  },
                "series": [
                    {"data": data, "type": "line" }
                ],
            }
            st_echarts(option1)

# 第五页 -- 绘制饼图
def pie_chart():
    st.header('绘制饼图')
    c = (
        Pie()
        .add("", [list(z) for z in zip(Faker.choose(), Faker.values())])
        .set_global_opts(title_opts=opts.TitleOpts(title="饼图"))
        .set_series_opts(label_opts=opts.LabelOpts(formatter="{b}: {c}"))
    )
    st_pyecharts(c)

def increment_counter():
    if st.session_state.count==4:
        st.session_state.count=0
    else:
        st.session_state.count += 1

def decrement_counter():
    if st.session_state.count==0:
        st.session_state.count=4
    else:
        st.session_state.count -= 1
    
def main():
    st.sidebar.title('页面导航：')
    if 'count' not in st.session_state:
        st.session_state.count = 0

    # 设置菜单项列表
    menu = ['Introduction', 'Data Overview (Head)', 'Data Overview (Describe)', 'Line Chart', 'Bar Chart', 'Pie Chart']
    choice = st.sidebar.selectbox('选择一个页面', menu, index=st.session_state.count)
    st.session_state.count=menu.index(choice)

    # 显示选定页面的内容
    if choice == 'Introduction':
        introduction()
    elif choice == 'Data Overview (Head)':
        data_overview_h()
    elif choice == 'Data Overview (Describe)':
        data_overview_c()
    elif choice == 'Line Chart':
        line_chart()
    elif choice == 'Bar Chart':
        bar_chart()
    elif choice == 'Pie Chart':
        pie_chart()
    else:
        introduction()
    
    cleft,cright=st.columns([5,1])
    cleft.button('next page', on_click=increment_counter)
    cright.button('last page', on_click=decrement_counter)
    components.html(
    """
    <script>
    const streamlitDoc = window.parent.document;
    
    const buttons = Array.from(streamlitDoc.querySelectorAll('.stButton > button'));
    //console.log(buttons) // find buttons in console tab
    
    const left_button = buttons.find(el => el.innerText === 'last page');
    const right_button = buttons.find(el => el.innerText === 'next page');
    
    left_button.style.backgroundColor = "coral"
    right_button.style.backgroundColor = "lightblue"
    
    streamlitDoc.addEventListener('keydown', function(e) {
        switch (e.key) {
            case 'ArrowLeft':
                left_button.click();
                break;
            case 'ArrowRight':
                right_button.click();
                break;
            case 'Enter':
                window.parent.navigator.clipboard.writeText(python_string)
                //window.parent.navigator.clipboard.readText().then((d) => {console.log(d)})
        }
    });
    </script>
    """,
    height=0,
    )
    

if __name__ == '__main__':
    main()